import {createWebHistory, createRouter} from "vue-router";

const routes = [
    {
        path: "/",
        alias: "/professions",
        name: "professions",
        component: () => import("./components/professions/ProfessionsList.vue")
    },
    {
        path: "/professions/:id",
        name: "profession-details",
        component: () => import("./components/./professions/Profession.vue")
    },
    {
        path: "/addProfession",
        name: "addProfession",
        component: () => import("./components/professions/AddProfession.vue")
    },
    {
        path: "/",
        alias: "/departments",
        name: "departments",
        component: () => import("./components/departments/DepartmentsList.vue")
    },
    {
        path: "/departments/:id",
        name: "department-details",
        component: () => import("./components/./departments/Department.vue")
    },
    {
        path: "/addDepartment",
        name: "addDepartment",
        component: () => import("./components/departments/AddDepartment.vue")
    },
    {
        path: "/",
        alias: "/employees",
        name: "employees",
        component: () => import("./components/employees/EmployeesList.vue")
    },
    {
        path: "/employees/:id",
        name: "employee-details",
        component: () => import("./components/./employees/Employee.vue")
    },
    {
        path: "/addEmployee",
        name: "addEmployee",
        component: () => import("./components/employees/AddEmployee.vue")
    }
];
const router = createRouter({
    history: createWebHistory(),
    routes,
});

export default router;
